import React from 'react';

import { Grid, IconButton, Menu, MenuItem, Tooltip } from '@mui/material';
import HomeIcon from '@mui/icons-material/Home';
import WorkIcon from '@mui/icons-material/Work';
import SportsSoccerIcon from '@mui/icons-material/SportsSoccer';
import ScienceIcon from '@mui/icons-material/Science';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';

import '../../style/menu.css';
import icon from '../../photo/ikonkaInicialy.jpeg';

function Navigation() {
  const [anchorEl, setAnchorEl] = React.useState<null | HTMLElement>(null);
  const open = Boolean(anchorEl);
  const handleClick = (event: React.MouseEvent<HTMLElement>) => {
    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);
  };
  return (
    <Grid
      container
      direction="row"
      justifyContent="space-between"
      alignItems="center"
      className="menu"
    >
      <Grid
        container
        direction="row"
        justifyContent="flex-start"
        alignItems="center"
        xs={4}
      >
        <img
          src={icon}
          alt={'Profile photo'}
          width="50px"
          style={{ borderRadius: '200px' }}
        />
      </Grid>
      <Grid
        container
        direction="row"
        justifyContent="center"
        alignItems="center"
        xs={4}
      >
        <Grid item>
          <Tooltip title="Home">
            <IconButton>
              <HomeIcon className="menu-icons" />
            </IconButton>
          </Tooltip>
        </Grid>
        <Grid item>
          <Tooltip title="Work">
            <IconButton>
              <WorkIcon className="menu-icons" />
            </IconButton>
          </Tooltip>
        </Grid>
        <Grid item>
          <Tooltip title="Hobby">
            <IconButton>
              <SportsSoccerIcon className="menu-icons" />
            </IconButton>
          </Tooltip>
        </Grid>
        <Grid item>
          <Tooltip title="Experience">
            <IconButton>
              <ScienceIcon className="menu-icons" />
            </IconButton>
          </Tooltip>
        </Grid>
      </Grid>
      <Grid
        container
        direction="row"
        justifyContent="flex-end"
        alignItems="center"
        xs={4}
      >
        <Grid item>
          <Tooltip title="Contact">
            <IconButton
              onClick={handleClick}
              size="small"
              sx={{ ml: 2 }}
              aria-controls={open ? 'account-menu' : undefined}
              aria-haspopup="true"
              aria-expanded={open ? 'true' : undefined}
            >
              <AccountCircleIcon
                className="menu-icons"
                sx={{ width: 32, height: 32 }}
              />
            </IconButton>
          </Tooltip>
          <Menu
            anchorEl={anchorEl}
            id="account-menu"
            open={open}
            onClose={handleClose}
            onClick={handleClose}
          >
            <MenuItem></MenuItem>
          </Menu>
        </Grid>
      </Grid>
    </Grid>
  );
}

export { Navigation };
